import React from 'react'
import styled from 'styled-components'
import Navbar from '../components/Navbar'

const Container = styled.div`
    height: 60px;
    background-color: black;
`
const Home = () => {
    return (
        <Container>
            <Navbar />
        </Container>
    )
}

export default Home
